import React from 'react';
import './BaseInputField.css';

function BaseInputField(props: any) {

  return (
    <div>
        <button className="basebutton" style={{width: props.width}} onChange={props.onClick}>
        {props.value}
        </button>
        <label className="baselabel">Username</label>
        <input className="baseinput" type="text" id="username" name="username" onChange={props.onChange} value={props.value} required />

    </div>
  )
};

export default BaseInputField
